def update_node_depth(node):
    if node.left and node.right:
        node.min_depth = min(node.left.min_depth, node.right.min_depth) + 1
        node.max_depth = max(node.left.max_depth, node.right.max_depth) + 1
    elif node.left:
        node.min_depth = 0
        node.max_depth = node.left.max_depth + 1
    elif node.right:
        node.min_depth = 0
        node.max_depth = node.right.max_depth + 1
    else:
        node.min_depth = 0
        node.max_depth = 0

def update_chain_depth(node):
    parent = node
    while parent:
        update_node_depth(parent)
        cur_parent = parent.parent

        if parent.max_depth - parent.min_depth >= 2:

            res_node = get_balance(parent)
            if res_node:
                if cur_parent:
                    connect(cur_parent, res_node)
                else:
                    return res_node

        parent = cur_parent


def get_edge_node(center, ind):
    if ind == 'left_to_right':
        new_center = get_left_right_most(center)
        new_center_child = new_center.left
    elif ind == 'right_to_left':
        new_center = get_right_left_most(center)
        new_center_child = new_center.right
    else:
        raise ValueError('This should not happen.')

    new_center_parent = new_center.parent
    disconnect(new_center_parent, new_center)
    if new_center_child:
        if not new_center_parent is center:
            disconnect(new_center, new_center_child)
            connect(new_center_parent, new_center_child)
        else:
            update_node_depth(new_center_parent)

    update_chain_depth(new_center_parent)
    return new_center

def get_center_disconnected(center):
    parent_of_center = center.parent
    center_left = center.left
    center_right = center.right

    disconnect(parent_of_center, center)
    disconnect(center, center_left)
    disconnect(center, center_right)
    return parent_of_center, center_left, center_right

def inset_center_to_shorter_branch(center, center_left, center_right, ind):
    if ind == 'left_to_right':
        if center_right:
            new_node = insert(center.value, center_right)
            res_node = update_chain_depth(new_node)
            if res_node:
                center_right = res_node
        else:
            center_right = Node.Node(center.value)
    elif ind == 'right_to_left':
        if center_left:
            new_node = insert(center.value, center_left)
            res_node = update_chain_depth(new_node)
            if res_node:
                center_left = res_node
        else:
            center_left = Node.Node(center.value)
    else:
        raise ValueError('This should not happen.')

    return center_left, center_right

def replace_center(new_center, parent_of_center, center_left, center_right):
    connect(parent_of_center, new_center)
    if center_left:
        connect(new_center, center_left)
    if center_right:
        connect(new_center, center_right)

    update_chain_depth(new_center)
    return

def balance_operation(center, ind):
    """

    Balance the tree from longer branch to the shorter branch.

    """

    # Get edge node from longer branch and pick it up
    new_center = get_edge_node(center, ind)

    # Disconnect center from its parent and children
    parent_of_center, center_left, center_right = get_center_disconnected(center)

    # Insert center into the shorter branch
    center_left, center_right = inset_center_to_shorter_branch(center, center_left, center_right, ind)

    # Replace center with the new center
    replace_center(new_center, parent_of_center, center_left, center_right)

    # Return new center if it is the root or it is disconnected
    if not parent_of_center:
        return new_center


def get_balance(node):
    if node == None:
        return
    center = node

    ind = ''
    if center.left and center.right:

        if center.left.max_depth - center.right.min_depth >=2:
            ind = 'left_to_right'
        elif center.right.max_depth - center.left.min_depth >=2:
            ind = 'right_to_left'

    elif center.left and center.left.max_depth >=1:
        ind = 'left_to_right'

    elif center.right and center.right.max_depth >=1:
        ind = 'right_to_left'

    else:
        return

    new_center = balance_operation(center, ind)
    if new_center:
        return new_center


def balance_insert(bst, value):
    if not bst.root:
        bst.root = Node.Node(value)
        return
    root = bst.root
    new_node = insert(value, root)
    new_root = update_chain_depth(new_node)
    if new_root:
        bst.root = new_root

def balance_delete(bst, value):
    pass

def batch_balance_insert(bst, node_list):
    for x in node_list:
        balance_insert(bst, x)

